import styles from "./Rating.module.scss";
import StarSvg from "./../Icons/StarSvg";

const Rating = () => {
  return (
    <div>
      <StarSvg />
      <span className={styles.notation}>{props.stars}</span>
    </div>
  );
};

export default Rating;
